import Vue from 'vue'
import VueRouter from 'vue-router'
import SearchUser from '../components/SearchUser'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: 'Main'

  },
  {
    path: '/about',
    name: 'about',
    component: 'SearchUser'

  }
]

const router = new VueRouter({
  routes
})

export default router
